import bugatti from './bugatti.png'
import imageCreate from './imager.js'
import './style.css'

function App() {
  const WIDTH = `600px`;
  const HEIGHT = `300px`;
  let ourImage = {
    src : bugatti,
    alt : 'son model bugatti',
    style : {
      width : WIDTH,
      height : HEIGHT,
    }
  }
  return (
    <div className='card'>
      <h1>Bugatti La Voiture Noire</h1>
      <div>{imageCreate(ourImage)}</div>
    </div>
  );
}

const other= () => (
  <div>
    <h2></h2>
    <p>13.4 million $$$</p>
    <p>Production: 1</p>
  </div>
)


export default App;
